const desc1 =
    "Vive la vie – niech żyje życie chciałoby się zakrzyczeć jadąc na KROSS Hexagon 3.0. To rower, na którym na nowo odkryjesz na radość płynącą z podróży w nieznane. Niezależnie od tego, czy będzie to droga przez ciemny las.";
const desc2 =
    "KROSS Hexagon 3.0 w 2021 roku to kontynuacja myśli przyświecającej nam przy projektowaniu poprzednich generacji tego roweru. To nie tylko nowy lakier położony na ramie.";

export { desc1, desc2 }
